import React from 'react';
import { Route, Switch } from 'react-router-dom';

import { HomePage } from '../pages';

const Hats = () => <h1>HATS</h1>;

const Routes = () => (
	<Switch>
		<Route exact path="/" component={HomePage} />
		<Route path="/hats" component={Hats} />
	</Switch>
);

export default Routes;
